                        <li><a href="#" id="ul2"><span className="glyphicon glyphicon-user" id="gf"></span> Create an account</a></li>
                        <li><a href="#" id="ul2"><span className="glyphicon glyphicon-log-in" id="gf"></span> LogIn</a></li>
                        </ul>
                       
                     </div>
       </div>
       
       
       
       </nav>
      <h2 id="titu">Breakfast Places in Mumbai</h2>
      <br/> <br/> <br/>
                        
    </div>
        )
        
    }
    componentDidMount()
    {
        
       // fetch(locurl,{method:'GET'})
       // .then((res)=> res.json)
       // .then((data)=>{
          //  console.log("hello")
           // console.log(data);
      //  })
      fetch(`${mealurl}/${localStorage.getItem('cityId')}/${this.props.match.params.id}`)
      .then((response)=>{
       response.json()
      .then((data) => {
        console.log(data);

      
    });
});
    }
}
export default Detail2
